import React from "react";
import "./App.css";
import { Container, Row, Col } from "react-bootstrap";
import Sidebar from "./components/sidebar/Sidebar";

function App() {
  <Container>
    <Row>
      <Col>Logo</Col>
      <Col>side bar Navigation</Col>
    </Row>
    <Row>
      <Col>1 of 3</Col>
      <Col>2 of 3</Col>
      <Col>3 of 3</Col>
    </Row>
  </Container>;
  return <Sidebar />;
}

export default App;
